import React, { useEffect, useState } from 'react'

const ViewQuestion = () => {

    const [listQuestions,setListQuestions]=useState("");

    useEffect(() => {
      viewQuestionFetch();
      },[]);
    
    
      function viewQuestionFetch(){
        fetch('https://localhost:8443/onlineexamapplication/control/viewQuestions'
         ).then((res=>res.json())).then((data=>{
             var questionList= data.questionList;
             console.log(questionList);
               setListQuestions(questionList)}))
      }
    console.log(listQuestions)

  return (
    <>
    
      <div className="container mt-5">
        <div className="row mt-5">
          <div className="col-sm-10 offset-md-1 mt-5">
            <div className="card-body">
              <table className="table">
                <thead className="">
                  <tr>
                    <th scope="col">TopicId</th>
                    <th scope="col">QuestionType</th>
                    <th scope="col">QuestionDetail</th>
                    <th scope="col">DifficultyLeavel</th>
                  </tr>
                 {listQuestions && listQuestions.map((question)=>{
                 return(<>
                 <tr>
                  <td>{question.topicId}</td>
                  <td>{question.questionDetail}</td>
                  <td>{question.topicId}</td>
                  <td>{question.topicId}</td>
                 </tr>
                
                 </>)})} 
                </thead>
              
              </table>
            </div>
          </div>
        </div>
      </div>
    </>
  )
}

export default ViewQuestion
